import React from 'react';
import {BrowserRoute, Link} from "react-router-dom";

const Navbar = () => {
 return (
        <nav>
            <ul>
             <p><Link to='/'>Koti</Link> |
                <Link to='/Kuvat'> Kuvat</Link>
                <Link to='/Mökki'> Mökki</Link>
                <Link to='/Peräkärry'> Kärry</Link>
                <Link to='/Ruohonleikkuri'> Leikkuri</Link></p>
            </ul>
        </nav>
    );
};

Navbar.propTypes = {};

export default Navbar;
